"檢測該商品的購買狀態為“待定”，但是我們還沒收到Google平台支付成功的狀態通知。如果您已經完成支付並扣款，可能是因為第三方支付通道的延遲導致的。請不用擔心，稍後我們在收到Google平臺支付成功通知的時候，將為您發放對應的商品。",sf_pending_order_checked_normal$1="我們收到了Google平臺的購買狀態通知，但是該商品的購買狀態為“待定”，所以我們暫時無法為您發放商品。 如果您已經完成支付並扣款，可能是因為協力廠商支付通道的延遲導致的。 請不用擔心，稍後我們在收到Google平臺支付成功通知的時候，將為您發放對應的商品。",sf_email_not_empty$1="請輸入您的郵箱帳號",sf_password_not_empty$1="請輸入您的密碼",sf_code_not_empty$1="請輸入郵箱驗證碼",sf_email_sent$1="郵箱驗證碼已發送",sf_loading$1="加載中，請稍後…",sf_email_code_tip$1="請輸入我們發送到您郵箱中的驗證碼",sf_register_failed$1="帳號注册失敗",sf_reset_password_failed$1="重置密碼失敗",sf_reset_password_success$1="密碼重置成功，請重新登入",sf_link_failed$1="帳號綁定失敗",sf_facebook_not_installed$1="該設備上未安裝Facebook應用，請選擇其他管道登入",sf_create_order_failed$1="創建訂單失敗",sf_pay_closed$1="支付功能已被關閉，請稍後再試",sf_update_title$1="升級提示",sf_update_content_force$1="檢測到新版本[]。 <br />因為有必要的新特性修改或更新，您只有更新到最新版本後，才能繼續遊戲",sf_update_content$1="檢測到新版本[]。 <br />為了獲得更好的體驗，我們建議您更新到最新的版本",sf_update_ok$1="立即升級",sf_update_cancel$1="取消",sf_update_url_error$1="升級URL錯誤",sf_web_location_tips$1=" 想要使用您設備的位置信息",sf_cancel_account_title$1="帳號註銷",sf_cancel_account_desc$1="遊戲帳號註銷功能需要在您當前遊戲角色離線時進行，點擊確定後將退出登錄並前往帳號註銷，您確定要退出登錄前往帳號註銷嗎？",sf_cancel_account_warn_tips$1="如果帳號註銷，遊戲數據會被清空，請謹慎操作",sf_account_protocol_prefix$1="我已詳細閱讀並同意",sf_account_protocol_check$1="請詳細閱讀並同意",sf_cancel_account_protocol$1="《遊戲帳號註銷協議》",sf_cancel_account_protocol_check$1="請先同意遊戲賬號註銷協議",sf_cancel_account_conditions_title$1="閱讀遊戲帳號註銷條件",sf_cancel_account_conditions_content$1="　　親愛的玩家，我們對您的註銷深表遺憾。為保證您的帳號和財產安全，在您提交的註銷申請生效前，請您確保已滿足以下條件，我們的遊戲團隊也有權視情況進行驗證：<br />　　1. 帳號處於安全狀態：帳號正常使用中，未處於違規處理期間（指帳號因為違反該遊戲相關協議、規則被採取封號或其他處理措施），且沒有被盜、被封等風險；<br />　　2. 遊戲收益已結清或得到妥善處理：包括但不限於遊戲代幣、其他遊戲虛擬道具以及其他遊戲增值服務（以下統稱“遊戲收益”）。請您妥善處理，若未處理，視為您自願放棄遊戲收益；<br />　　3. 帳號無未完成狀態訂單：包括充值遊戲代幣，購買其他遊戲虛擬道具及其他周邊商品等。<br />　　4. 如存在遊戲內社群創建者身份、親密關係及其他互動關係：請確保這些社交關係解除（創建遊戲內社群的需解除創建者身份）。<br />　　5. 帳號無任何糾紛：包括投訴舉報、被投訴舉報、仲裁、訴訟等糾紛。",sf_cancel_account_conditions_meet$1="我已滿足上述註銷條件",sf_cancel_account_agreement_title$1="閱讀遊戲帳號註銷協議",sf_cancel_account_agreement_content$1="　　尊敬的玩家，在您正式開始下一步有關本遊戲的遊戲帳號註銷流程前，請務必先詳細閱讀並同意《遊戲帳號註銷協議》（以下簡稱“本協議”）。您勾選本協議並點擊下一步操作，即視為您已經同意和遵守本協議全部內容。我們在此特別提醒您：<br />　　如您成功提交帳號撤銷申請，我們將從您提交帳號註銷次日起，為您保留該帳號15日。在此期間，我們暫時不會刪除該帳號的相關資訊（如您的好友仍可見您的頭像、昵稱等帳號資訊）。如果您在此期間，使用該帳號登陸此遊戲，將視為您撤銷該帳號註銷申請。在此之後，我們將完成該帳號註銷，刪除或匿名化處理您的相關個人資訊。<br />　　註銷本遊戲帳號後，除法律法規和本協議另有規定外，您的該遊戲帳號將會被刪除或匿名化處理，您無法再檢索、訪問、獲取、繼續使用和找回，也無權要求我們找回個人資訊，前述個人資訊包括但不限於：頭像、昵稱、購買或遊戲內獲得的一切遊戲虛擬道具及其他增值服務、發言、地區、遊戲中聊天記錄等內容。<br />　　有關遊戲帳號註銷的其他詳細規則及注意事項請點擊查看《遊戲帳號註銷協議》。",sf_cancel_account_protocol_content$1="　　在您註銷您的帳號之前，請充分閱讀、理解並同意下列事項：<br />　　【特別提示】成功註銷本帳號為不可恢復的操作，註銷帳號後您將無法再使用本帳號或找回您流覽、綁定的任何遊戲相關的內容或資訊（即使您使用相同的手機號碼、郵箱或其他第三方帳號再次註冊並使用）。<br />　　建議您在註銷前自行備份帳號相關的所有資訊，並請確認與本帳號相關的所有服務均已進行妥善處理。註銷完成後，我們將刪除您的個人資訊或對其進行匿名化處理（法律法規另有規定的除外）。<br /><br />　　1. 我們對您註銷帳號的決定深表遺憾。如果您仍決定繼續進行帳號註銷，您的帳號需同時滿足以下條件：<br />　　1.1. 帳戶處於安全狀態：帳號處於正常使用狀態，經平臺安全檢查無被盜用風險。<br />　　1.2. 帳號財產已結清，沒有未完成或存在爭議的服務：帳號中沒有資產、欠款、未結清的資金和虛擬權益；本帳號及通過本帳號接入的第三方中沒有未完成或存在爭議的服務。<br />　　1.3. 帳號許可權解除：帳號已解除與第三方產品、網頁授權登錄或綁定關係。<br />　　1.4. 帳號無任何未結爭議糾紛，包括投訴舉報或被投訴舉報。<br /><br />　　2. 帳號註銷後，您將無法登錄、使用本帳號，也將無法找回本帳號中及與帳號相關的任何內容或資訊，包括但不限於：<br />　　2.1. 個人已提交的身份資訊、帳號資訊、遊戲相關數據等資訊。<br />　　2.2. 通過本帳號使用、授權登錄或綁定本帳號後使用的第三方服務相關記錄將無法找回。您將無法再登錄、使用上述服務，通過上述服務曾獲得的資產或虛擬權益等財產性利益視為您同意放棄，將無法繼續使用。您理解並同意，我們無法協助您重新恢復上述服務。<br />　　2.3 帳號內錢包帳戶餘額、獎勵、收益、實名制認證資訊、交易記錄、已綁定的銀行卡等資訊將被作廢及刪除。<br /><br />　　3.帳號註銷將導致我們終止為您提供服務，依遊戲《用戶服務協議》和《隱私政策》等約定的雙方權利義務終止。<br /><br />　　4. 在您的帳號註銷期間，如果您的帳號涉及爭議糾紛，包括但不限於：投訴、舉報、訴訟、仲裁、國家機關調查等，您理解並同意，我們有權自行決定是否終止本帳號的註銷而無需另行得到您的同意。<br /><br />　　5. 註銷本帳號並不代表本帳號註銷前的帳戶行為和相關責任得到赦免或減輕。",sf_cancel_account_agreement_agree$1="我已詳細閱讀並同意",sf_cancel_account_notice_title$1="註銷需知",sf_cancel_account_notice_content$1="　　為防止誤操作，請再次確認是否註銷帳號並確認註銷後的影響。該影響包括但不限於（具體詳見《遊戲帳號註銷協議》）<br />　　1. 該帳號一旦註銷，您將無法登錄、使用該遊戲帳號，且無法恢復。除法律法規或遊戲帳號註銷協議另外有規定外，該遊戲帳號下的個人資訊將會被刪除或匿名化處理。您將無法再找回您的個人資訊，也無權要求我們找回。<br />　　2. 該帳號一旦註銷，該帳號下的遊戲代幣、其他遊戲虛擬道具以及其他增值服務（以下統稱：“遊戲收益”）也將會被清除。據此，也特別提醒您，在您註銷本遊戲帳號前請確保已妥善處理該遊戲帳號下的遊戲收益或相關的遊戲收益已結清。一旦您註銷本遊戲帳號，將視為您自願放棄該遊戲收益，我們有權對該遊戲帳號下的全部遊戲收益做清除處理，因此產生的後果由您自行承擔。",sf_cancel_account_not